let constants = {
    DISTANCE_TO_MOON_IN_FEET: '200',
    COLOR_OF_MOON_MOUNTAINS: '#ff00ff'
};

let moonKing = 'TOM';

function getMoonTemperature(time) {
    return time + 2;
}

export { moonKing, getMoonTemperature };

export default constants;
